import React from 'react';
import styled from 'styled-components';

const Box = styled.div`
  width: 90%;
  height: 100%;
  margin: 0 auto;
  border: 1px solid black;
`;

function Container({ children }) {
  return <Box>{children}</Box>;
}

export default Container;
